class FlowLmtIntfClass(TextualConvention, Integer32):
    description = 'The classes of interfaces, or ports, available under the Flow Limiting feature. userPort A port with a single user (workstation, PC, etc.) attached to it. serverPort A port with a server attached to it. This class may encompass a wide range of server types from a small workgroup print server to an enterprise exchange server. Alternately, an administrator may choose to configure an interface with a small print server as a userPort since their flow setup needs may be similar to that of a user port. aggregatedUserPort A port likely to have multiple end stations attached either through a wireless access point or an unmanaged low cost hub or switch. It is expected that this class may also be used instead of interSwitchLink when switches are interconnected using a lower speed link. interSwitchLink A port that is used as a high-speed interconnect between two intelligent switches or routers. Unspecified A port in which nothing can be assumed about its intended use. These classes are only guides. The classes can be configured with any limits, and any interface can associated with any class.'
