class FlowLmtIntfAction(TextualConvention, Bits):
    description = "The possible actions that the Flow Limiting feature can take when flow activity exceeds the associated action limits. generateNotification(0) - Generate the respective SNMP notification. dropExcessFlows(1) - Drop flow setup requests in excess of the configured limit and discard the associated packets. The use of this option could cause the entity to repetitively process setup requests for the dropped flows. The process of dropping flow setup requests and their associated packets could cause end stations attached to this interface to behave in an indeterminate manner. The use of this option may also prevent the entity from being able to count additional flows and from reaching any additional configured limit. createDiscardFlows(2) - Create discard flows and discard the associated packets. The use of this option could cause end stations attached to this interface to behave in an indeterminate manner. disableInterface(3) - Operationally disable the interface, ifOperStatus for the interface MUST go into the 'down' state, and MUST remain in that state until the associated etsysFlowLimitingIntfStatus is set to operational, the Flow Limiting feature is disabled, or the entity is reset. The 'generateNotification(0)' will always be performed if it is a selected action, is globally enabled, and does not exceed the global rate limit for such notifications. It MUST be generated in such a way that the information in the notification indicates the condition on the interface after any other indicated action has been taken. If one or more other actions are selected only the one with the highest precedence will be taken. The order of precedence, from highest to lowest, of the actions are 'disableInterface', 'createDiscardFlows', and finally 'dropExcessFlows'. If etsysFlowLimitingSystemInterfaceShutdown is disabled the selected action with the next highest precedence will be taken."
    status = 'current'
    namedValues = NamedValues(("generateNotification", 0), ("dropExcessFlows", 1), ("createDiscardFlows", 2), ("disableInterface", 3))

